import data from './data.json'
import styles from './App.module.css';
import Header from './components/MenuHeader';
import Food from './components/Food.js';
import FoodDrink from './components/FoodDrink';


  class App extends React.Component {
    constructor(props)
    {
      super(props);
      this.state = {
        items: data.items,
        productSearchString: "",
      }
    }
  

  return ()
  {

  <div>
  <Header />
  <div className={styles.paasivubar}>
    <FoodDrink  topic='Pizzat'/>
    </div>
    <div className={styles.paasivubar}>
    <FoodDrink  topic='Burgerit'/>
    </div>
    <div className={styles.paasivubar}>
    <FoodDrink  topic='Juomat'/>
    </div>
    </div>

  }
  
}

export default App;
